import React, { Component } from 'react'
import axios from 'axios'

class Posts1 extends Component {
    constructor(props)
    {
        super(props)

        this.state={
            userid:null,
            title:null,
            body:null
        }
    }
    onChangehandler=(e)=>{
        this.setState({
            [e.target.name]:[e.target.value]
        })
    }

    submithandler=(e)=>{
        e.preventDefault();
        console.log(this.state)
        axios.post('https://jsonplaceholder.typicode.com/posts',this.state)
        .then(res=>{
            console.log(res)
        })
        .catch(error=>{
            console.log(error)
        })
    }
    render() {
        const {userid,title,body}=this.state
        return (
            <div>
                <form onSubmit={this.submithandler}>
                    <div>
                        <input type="text" name="userid" value={userid} onChange={this.onChangehandler}/>
                        <input type="text" name="title" value={title} onChange={this.onChangehandler}/>
                        <input type="text" name="body" value={body} onChange={this.onChangehandler}/>
                        <button type="submit">Submit</button>
                    </div>
                </form>
            </div>
        )
    }
}

export default Posts1
